import React from 'react'
import TableDataRow from './TableDataRow'
import "../style/TableData.css"

export default function TableData({data}) {
    const renderTodos = data.map((value, index) => {
        return <TableDataRow
            key={index}
            user={value}
        />;
    });
    return (
        <div >
            <div>Danh ss</div>
            <table className="table-css">
                <thead><tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Created</th>
                    <th>Update</th>
                </tr>
                </thead>
                <tbody>
                    {renderTodos}
                </tbody>
            </table>
        </div>
    )
}
